import NavBar from "./NavBar"
import "./All.css"

const data = {
    login: {
        title: "Login",
        data: 'Dashbord'
    },
    logout: {
        title: "Logout"
    },
}


function Main() {
    return (
        <div className="mainsection">
            <NavBar data={data}/>

        </div>
    )
}
export default Main
